function App() {
  return (
    <div>
      <h1>My Contacts</h1>
      <div className="card"></div>
      <div className="top">
        <h2>Hima Das</h2>
        <img
          src="https://im.rediff.com/sports/2018/apr/10hima.jpg?w=300&h=400"
          alt="avatar_img"
        />
      </div>
      <div className="bottom">
        <p>+123 456 789</p>
        <p>himadas@india.com</p>
      </div>
    </div>
  );
}

export default App;
